		{
			get
			{
				if(Bounds != null)
				{
					IFC_Attributes<Global.IFCFaceBound>? items = new IFC_Attributes<Global.IFCFaceBound>();
					foreach (IFCFaceBound item in Bounds)
					{
						items.Add(item);
					}
					return items;
				}
				return null;
			}
			set
			{
				if(value == null)
				{
					Bounds = null;
				}
				else
				{
					Bounds = new IFC_Attributes<IFCFaceBound>();
					foreach(var val in value)
